                let dateFormat = allNotes[i].createdAt;
                
            }
            // console.log("usersss", allNotes.length)
            // console.log(response.data.createdAt)

        })
    }

    useEffect(() => {
        getNotes();
    }, [])

    return (
        <div>
            <h1>My notes</h1>
            {
                notes.map((note) => {
                    return <>
                        <h3>{note.title}</h3>
                        <div>{note.description}</div>
                        <div>{note.createdAt}</div>
                    </>
                })
            }
        </div>
    )
}

export default MyNotes
